import React from "react";

const Header = ({
  currentScore,
  currentLevel,
  bestScore,
  codeIsActivated,
  totalLives,
}) => {
  return (
      <nav class="header navbar navbar-dark bg-dark">
        <a class="navbar-brand">
          Navbar w/ text
        </a>
        <span class="navbar-text">Level: {currentLevel} Score: {currentScore} Best Score: {bestScore}</span>
        {codeIsActivated && <span class="navbar-text">Lives Left: {totalLives}</span>}
      </nav>
  );
};

export default Header;
